import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import './App.css';
import LoginPage from "./pages/login/login-page";

class App extends Component {
  render() {
    return (
        <Router>
          <Switch>
            <Route path="/login">
              <LoginPage/>
            </Route>
          </Switch>
        </Router>
    );
  }
}

export default App;
